            title:'红包'
          }
        },
      ]
    },
    {
      path: "/error",
      name: "error",
      componentName: 'error/error',
      meta: { 
        title: '404'
       }
    },
    {
      path: '*',  // * 表示上面路径匹配不到的都显示这个页面
      name: '404',
      componentName: 'error/404',
      meta: { 
        title: '404'
      }
    },
  ];
  
  
const formatRouter = (list) => {
  list.map(item => {
    let str = `@/views/${item.componentName}.vue`
    if (process.env.NODE_ENV === 'development') {
      if(!item.component) {
        item.component = () => {
          return require(`@/views/${item.componentName}.vue`).default
        }
      }
    } else {
      if(!item.component) {
        item.component = () => import(`@/views/${item.componentName}.vue`)
      }
    }
    console.log('00000000item', item, str)
    if(item.children && item.children.length) {
      formatRouter(item.children)
    }
  })
}
formatRouter(initRoutes)
let routes = initRoutes
console.log(routes, '----------------routes', initRoutes)
